import React, { Component } from "react";
import logo1 from "./logo_transparent.png";
import "./header.css";
// import { BrowserRouter as Router, Switch, Route, Link,browserHistory } from "react-router-dom";
import { Router, Route, Link, RouteHandler } from "react-router";
import JobPostPage from "../job_post_page/job_post_page";

class AppHeader extends Component {
  render() {
    return (
      <Router>
        <header>
          <Link to="/">
            <div id="logo"></div>
          </Link>
          <Link to="../job_post_page/job_post_page">
            <div id="post_job">
              <button type="button" name="button">
                Post a Job
              </button>
            </div>
          </Link>
        </header>
      </Router>
    );
  }
}

export default AppHeader;
